import Data from "./data.json"


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Banner />
      </header>
      <Routes>


        <Route path="/" element={<Accueil />} />
        <Route path="/a-propos" element={<APropos />} />
        <Route path="/a-propos2" element={<APropos name="Moi" />} />

      </Routes>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

